import React from "react";

function AccountTypes({ heading, text, icon }) {
  return (
    <div className="container p-4 border mb-5" style={{ width: "30%" }}>
      <div>
        <h4>
          {icon} {heading}
        </h4>
      </div>

      <p className="fs-5">{text}</p>
    </div>
  );
}

export default AccountTypes;
